import React from "react";

function Layout() {
  return (
    <div className="layout">
      <header>
        <img
          className="logo"
          alt="brand logo"
          src="/assets/shared/desktop/logo.svg"
        />
        <nav>
          <Link />
        </nav>
      </header>
    </div>
  );
}

export default Layout;
